(function ($) {
    $.widget("sylightsUI.switchButton", {
        options: {
            checked: undefined,
            show_labels: true,
            labels_placement: "both",
            on_label: "ON",
            off_label: "OFF",
            width: 25,
            height: 11,
            button_width: 12,
            clear: true,
            clear_after: null,
            on_callback: undefined,
            off_callback: undefined
        },
        _create: function () {
            if (this.options.checked === undefined) {
                this.options.checked = this.element.prop("checked");
            }
            this._initLayout();
            this._initEvents();
        },
        _initLayout: function () {
            this.element.hide();
            this.off_label = $("<span>").addClass("switch-button-label");
            this.on_label = $("<span>").addClass("switch-button-label");
            this.button_bg = $("<div>").addClass("switch-button-background");
            this.button = $("<div>").addClass("switch-button-button");
            this.off_label.insertAfter(this.element);
            this.button_bg.insertAfter(this.off_label);
            this.on_label.insertAfter(this.button_bg);
            this.button_bg.append(this.button);
            if (this.options.clear) {
                if (this.options.clear_after === null) {
                    this.options.clear_after = this.on_label;
                }
                $("<div>").css({
                    clear: "left"
                }).insertAfter(this.options.clear_after);
            }
            this._refresh();
            this.options.checked = !this.options.checked;
            this._toggleSwitch();
        },
        _refresh: function () {
            if (this.options.show_labels) {
                this.off_label.show();
                this.on_label.show();
            } else {
                this.off_label.hide();
                this.on_label.hide();
            }
            switch (this.options.labels_placement) {
                case"both":
                {
                    if (this.button_bg.prev() !== this.off_label || this.button_bg.next() !== this.on_label) {
                        this.off_label.detach();
                        this.on_label.detach();
                        this.off_label.insertBefore(this.button_bg);
                        this.on_label.insertAfter(this.button_bg);
                        this.on_label.addClass(this.options.checked ? "on" : "off").removeClass(this.options.checked ? "off" : "on");
                        this.off_label.addClass(this.options.checked ? "off" : "on").removeClass(this.options.checked ? "on" : "off");
                    }
                    break;
                }
                case"left":
                {
                    if (this.button_bg.prev() !== this.on_label || this.on_label.prev() !== this.off_label) {
                        this.off_label.detach();
                        this.on_label.detach();
                        this.off_label.insertBefore(this.button_bg);
                        this.on_label.insertBefore(this.button_bg);
                        this.on_label.addClass("on").removeClass("off");
                        this.off_label.addClass("off").removeClass("on");
                    }
                    break;
                }
                case"right":
                {
                    if (this.button_bg.next() !== this.off_label || this.off_label.next() !== this.on_label) {
                        this.off_label.detach();
                        this.on_label.detach();
                        this.off_label.insertAfter(this.button_bg);
                        this.on_label.insertAfter(this.off_label);
                        this.on_label.addClass("on").removeClass("off");
                        this.off_label.addClass("off").removeClass("on");
                    }
                    break;
                }
            }
            this.on_label.html(this.options.on_label);
            this.off_label.html(this.options.off_label);
            this.button_bg.width(this.options.width);
            this.button_bg.height(this.options.height);
            this.button.width(this.options.button_width);
            this.button.height(this.options.height);
        },
        _initEvents: function () {
            var self = this;
            this.button_bg.click(function (e) {
                e.preventDefault();
                e.stopPropagation();
                self._toggleSwitch();
                return false;
            });
            this.button.click(function (e) {
                e.preventDefault();
                e.stopPropagation();
                self._toggleSwitch();
                return false;
            });
            this.on_label.click(function (e) {
                if (self.options.checked && self.options.labels_placement === "both") {
                    return false;
                }
                self._toggleSwitch();
                return false;
            });
            this.off_label.click(function (e) {
                if (!self.options.checked && self.options.labels_placement === "both") {
                    return false;
                }
                self._toggleSwitch();
                return false;
            });
        },
        _setOption: function (key, value) {
            if (key === "checked") {
                this._setChecked(value);
                return;
            }
            this.options[key] = value;
            this._refresh();
        },
        _setChecked: function (value) {
            if (value === this.options.checked) {
                return;
            }
            this.options.checked = !value;
            this._toggleSwitch();
        },
        _toggleSwitch: function () {
            this.options.checked = !this.options.checked;
            var newLeft = "";
            if (this.options.checked) {
                this.element.prop("checked", true);
                this.element.change();
                var dLeft = this.options.width - this.options.button_width;
                newLeft = "+=" + dLeft;
                if (this.options.labels_placement == "both") {
                    this.off_label.removeClass("on").addClass("off");
                    this.on_label.removeClass("off").addClass("on");
                } else {
                    this.off_label.hide();
                    this.on_label.show();
                }
                this.button_bg.addClass("checked");
                if (typeof this.options.on_callback === 'function')
                    this.options.on_callback.call(this);
            } else {
                this.element.prop("checked", false);
                this.element.change();
                newLeft = "-1px";
                if (this.options.labels_placement == "both") {
                    this.off_label.removeClass("off").addClass("on");
                    this.on_label.removeClass("on").addClass("off");
                } else {
                    this.off_label.show();
                    this.on_label.hide();
                }
                this.button_bg.removeClass("checked");
                if (typeof this.options.off_callback === 'function')
                    this.options.off_callback.call(this);
            }
            this.button.animate({
                left: newLeft
            }, 250, "easeInOutCubic");
        }
    });
})(jQuery);
;

$.ajaxPrefilter(function (options, originalOptions, jqXHR) {
    function hasLocalStorage() {
        var mod = 'modernizr';
        try {
            localStorage.setItem(mod, mod);
            localStorage.removeItem(mod);
            return true;
        } catch (e) {
            return false;
        }
    }

    if (!hasLocalStorage() || !options.localCache)
        return;
    var hourstl = options.cacheTTL || 5;
    var cacheKey = options.cacheKey || options.url.replace(/jQuery.*/, '') + options.type + (options.data || '');
    if (options.isCacheValid && !options.isCacheValid()) {
        localStorage.removeItem(cacheKey);
    }
    var ttl = localStorage.getItem(cacheKey + 'cachettl');
    if (ttl && ttl < +new Date()) {
        localStorage.removeItem(cacheKey);
        localStorage.removeItem(cacheKey + 'cachettl');
        ttl = 'expired';
    }
    var value = localStorage.getItem(cacheKey);
    if (value) {
        if (options.dataType.indexOf('json') === 0)
            value = JSON.parse(value);
        options.success(value);
        jqXHR.abort();
    } else {
        if (options.success) {
            options.realsuccess = options.success;
        }
        options.success = function (data) {
            var strdata = data;
            if (this.dataType.indexOf('json') === 0)
                strdata = JSON.stringify(data);
            try {
                localStorage.setItem(cacheKey, strdata);
            } catch (e) {
                localStorage.removeItem(cacheKey);
                localStorage.removeItem(cacheKey + 'cachettl');
                if (options.cacheError)
                    options.cacheError(e, cacheKey, strdata);
            }
            if (options.realsuccess)
                options.realsuccess(data);
        };
        if (!ttl || ttl === 'expired') {
            localStorage.setItem(cacheKey + 'cachettl', +new Date() + 1000 * 60 * 60 * hourstl);
        }
    }
});
