var getSearchIcon = function (type) {
    var $res = 'defalut-icon';
    switch (type) {
        case'facebook':
            $res = 'facebook-icon';
            break;
        case'instagram':
            $res = 'instagram-icon';
            break;
        case'youtube':
            $res = 'youtube-icon';
            break;
        case'twitter':
            $res = 'twitter-icon';
            break;
        case'vine':
            $res = 'vine-icon';
            break;
    }
    return $res;
}

